[:div [:big [:big \"...\"]]]]], \"127\" [:div nil [:div [:p/markdown \"All other notes witn no explicit metadata are assigned the kind `:naive` automatically.\"]]], \"11\" [:div [:p/code {:code \"(def p2 (promise))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"109\" [:div nil [:div [:p/markdown \"### md\\n\\nNotes of kind `:md` are expected to return a seq of strings. These strings are concatenated and renderdered as Markdown.\"]]], \"124\" [:div nil [:div [:p/markdown \"## Other ways to specify note kinds.\\n\\nA note's kinds can also be specified by including it in a vector beginning with a keyword. This is inspired by the approach of [Oz](https://github.com/metasoarous/oz), and should allow some partial compatibility with Oz notebooks.\"]]], \"138\" [:div [:p/code {:code \"^k/naive\\n(->> (partial rand-int 6)\\n     (partial repeatedly 6)\\n     (repeatedly 6))\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"((3 1 2 3 2 2)\\n (4 5 4 0 2 1)\\n (0 2 1 3 1 5)\\n (5 4 4 3 5 4)\\n (1 5 2 5 4 0)\\n (0 3 5 0 5 4))\\n\"}]]], \"45\" [:div [:p/code {:code \"^k/md\\n[\\\"##### text:\\\"\\n \\\"* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\\\"]\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"114\" [:div nil [:div [:p/markdown \"### hiccup\\n\\nA `:hiccup` note renders its value as Hiccup.\"]]], \"198\" [:div [:p/code {:code \"(A a)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"{:x 4}\\n\"}]]], \"56\" [:div [:p/code {:code \"^k/hiccup\\n[:p/player\\n {:width  \\\"100%\\\"\\n  :height \\\"100%\\\"\\n  :url    \\\"https://www.youtube.com/watch?v=G512fvK9KXA\\\"}]\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"32\" [:div [:p/code {:code \"(A a)\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"133\" [:div [:p/code {:code \"p2\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"14\\n\"}]]], \"147\" [:div nil [:div [:p/markdown \"If you evaluated the code in the comment below once, then you should see `{:x 4}`. Otherwise, you should still see `{:x 3}`.\"]]], \"151\" [:div [:p/code {:code \"^k/void\\n(comment\\n  (swap! a update :x inc))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"55\" [:div [:p/code {:code \"^k/hiccup\\n(into [:ul]\\n      (for [i (range 9)]\\n        [:li\\n         i \\\" \\\"\\n         [:p/sparklinespot\\n          {:data      (for [j (range 999)]\\n                        (+ (* 0.2 (rand))\\n                           (Math/sin (* i j))))\\n           :limit     100\\n           :svgWidth  100\\n           :svgHeight 20}]]))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"182\" [:div nil [:div [:p/markdown \"## Unit tests\\n\\nComing soon.\"]]], \"85\" [:div nil [:div [:p/markdown \"The following note should render after two seconds (of waiting for `x` to be realized).\"]]], \"189\" [:div [:p/code {:code \"(A a)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"{:x 3}\\n\"}]]], \"126\" [:div nil [:div [:p/markdown \"Notes which are sequential forms beginning with a string (e.g., `[\\\"Hello!\\\" \\\"How are you?\\\"]`) are assigned the default kind `:md-nocode`  automatically.\\nThis very text you are reading is an example of a note of that kind.\"]]], \"2\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"143\" [:div [:p/code {:code \"(D (+ 1 2))\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"3\\n\"}]]], \"178\" [:div nil [:div [:p/markdown \"Notes which are sequential forms beginning with a string (e.g., `[\\\"Hello!\\\" \\\"How are you?\\\"]`) are assigned the default kind `:md-nocode`  automatically.\\nThis very text you are reading is an example of a note of that kind.\"]]], \"72\" [:div nil [:div [:p/markdown \"### Editor integration\\n\\nFor a convenient interactive experience, it is ecommended to bind the Notespace API functions to functions of your editor.\\n\\nYou can see how to do this in Emacs in [this Elisp code](https://github.com/scicloj/notespace/blob/v3/emacs-config.el). In the future, we will probably provide similar solutions for other editors too.\"]]], \"170\" [:div nil [:div [:p/markdown \"### extended hiccup\\n\\nIn fact, `:hiccup` and `:hiccup-nocode` render by an extended version of Hiccup, that supports [gorilla-ui](https://github.com/pink-gorilla/gorilla-ui) tags.\\n\\nHere are some examples.\"]]], \"54\" [:div [:p/code {:code \"^k/hiccup\\n[:div\\n [:h5 \\\"Plot:\\\"]\\n [:p/sparklinespot\\n  {:data      (->> #(- (rand) 0.5)\\n                   (repeatedly 99)\\n                   (reductions +))\\n   :svgHeight 20}]]\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"16\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"131\" [:div [:p/code {:code \"(deliver p2 14)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"14\\n\"}]]], \"103\" [:div nil [:div [:p/markdown \"Let us see what kinds of notes we have.\\n\\n### naive\\n\\nA `:naive` note renders its value by pretty-printing it.\"]]], \"41\" [:div [:p/code {:code \"^k/void\\n(+ 1 2)\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"91\" [:div nil [:div [:p/markdown \"If you called `notespace.api/eval-and-realize-note-at-line` with the line holding this note, then you should see the number 3 there. Otherwise, you should see a mark that says it is still pending.\"]]], \"10\" [:div [:p/code {:code \"(def p1 (promise))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"65\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"40\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"161\" [:div nil [:div [:p/markdown \"### md\\n\\nNotes of kind `:md` are expected to return a seq of strings. These strings are concatenated and renderdered as Markdown.\"]]], \"129\" [:div nil [:div [:p/markdown \"## Interactive input and reactive notes\\n\\nComing soon.\"]]], \"187\" [:div [:p/code {:code \"(D (+ 1 2))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"31\" [:div [:p/code {:code \"(def a\\n  (atom {:x 3}))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"71\" [:div nil [:div [:p/markdown \"## Basic workflow\\n\\nTypically, you may like to edit one or more namespaces, that may be about function definitions, tests, data exploration, etc., and have Notespace update its notebook view while these namespaces evolve. At some point, you may like to render the view as a standalone html file for documentation.\\n\\nSee [this screencast](https://www.youtube.com/watch?v=_GcTnkhn9g0) for a recorded session. Note, however, that the note kinds defined in the screencast are a bit different from those of the current version.\\n\\nLet us see how to do this with the Notespace API.\\n### The main API functions\\n#### init\\n\\nUse `notespace.api/init` to initialize the Notespace system's state.\\n\\nIn the beginning of your work, you need to use it.\\n\\nYou can also use it afterwards. That is useful if you run into an unstable state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### init-with-browser\\n\\nUse `notespace.api/init-with-browser` to initialize the Notespace system's state and open a browser tab with a notebook view of the last namespace touched.\\n\\nIn the beginning of your work, you can use it instead of `init`.\\n\\nYou can always refersh the browser tab. That is useful if it runs out of sync with the system's state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### eval-this-notespace\\n\\nUse `notespace.api/eval-this-notespace` to evaluate the current namespace, one note after another, and inform Notespace about the evaluation results, one after another.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n#### eval-note-at-line\\n\\nUse `notespace.api/eval-note-at-line` to evaluate the note at a certain line and inform Noteapace about the evaluation result.\\n\\nFor example, `(notespace.api/eval-note-at-line 14)` applies that to the note at line 14.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n\\nThis is useful for re-evaluating parts of the notebook, whose evaluation result may have changed for some reason.\\n#### render-static-html\\n\\nUse `notespace.api/render-static-html` to render the Notespace state of the notespace last touched as a standalone html file. This html should look exactly as the dynamic browser view at the moment of rendering.\"]]], \"164\" [:div nil [:div [:p/markdown \"### md-nocode\\n\\nNotes of kind `:md-nocode` are rendered as Markdown too, but without showing the code. Here is an example:\"]]], \"163\" [:div [:p/code {:code \"^k/md\\n(cons\\n \\\"##### numbers:\\\"\\n (for [i (range 1 4)]\\n   (apply str \\\"* \\\" (repeat i i))))\", :bg-class \"bg-light\"}] [:div [:p/markdown \"##### numbers:\\n* 1\\n* 22\\n* 333\"]]], \"86\" [:div [:p/code {:code \"(F (take 9 @x))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"64\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"92\" [:div nil [:div [:p/markdown \"### Atoms\"]]], \"23\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"52\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"79\" [:div nil [:div [:p/markdown \"### More API functions\\n\\nNotespace offers some more API functions that allow for a dynamic experience with Clojure references.\"]]], \"160\" [:div nil [:div nil]], \"29\" [:div [:p/code {:code \"(require '[notespace.api :refer [A]])\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"150\" [:div [:p/code {:code \"(A a)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"{:x 4}\\n\"}]]], \"117\" [:div nil [:div [:big [:big 3]]]], \"132\" [:div [:p/code {:code \"p1\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]]}}");
